import React from 'react';
import { ImageBackground,Text } from 'react-native';


function App(){
  return(
    <ImageBackground source={require("./assets/maxresdefault.jpg")}>
      <Text>Hello</Text>
    </ImageBackground>
  );
}

export default App;
